import React from 'react';
import Link from 'next/link';

export const Header = () => {
    return (
        <nav>
            <Link href="/">
                <a className="nav-link" title="Home">Home</a>
            </Link>
            <Link href="/posts">
                <a className="nav-link" title="List of posts">List of posts</a>
            </Link>
            <Link href="/new">
                <a className="nav-link" title="New post">New post</a>
            </Link>
        </nav>
    );
}
